import React, { useRef, useState } from "react";

// Unified protocol array: clinical and traditional
const PROTOCOLS = [
  // Clinical
  {
    id: 'gamma-40hz',
    label: '40Hz Gamma',
    frequency: 40,
    mode: 'single',
    tier: 'Tier 1',
    evidence: 'Peer-reviewed (Multiple RCTs)',
    modality: 'Speakers or headphones',
    duration: '60 min daily',
    notes: 'Neurodegenerative prevention, mild cognitive impairment, sleep quality.',
    contraindications: 'Tinnitus, seizure disorders.',
    type: 'clinical',
  },
  {
    id: 'delta-binaural',
    label: 'Delta (2–4Hz) Binaural',
    left: 200,
    right: 202,
    mode: 'binaural',
    tier: 'Tier 2',
    evidence: 'Peer-reviewed (Promising RCTs)',
    modality: 'Headphones',
    duration: '20–45 min',
    notes: 'Sleep initiation, anxiety reduction.',
    contraindications: 'Tinnitus, seizure disorders.',
    type: 'clinical',
  },
  {
    id: 'theta-binaural',
    label: 'Theta (6Hz) Binaural',
    left: 200,
    right: 206,
    mode: 'binaural',
    tier: 'Tier 2',
    evidence: 'Peer-reviewed (Promising RCTs)',
    modality: 'Headphones',
    duration: '15–30 min',
    notes: 'Deep relaxation, meditation depth.',
    contraindications: 'Tinnitus, seizure disorders.',
    type: 'clinical',
  },
  // Traditional
  {
    id: 'solfeggio-528',
    label: '528Hz Solfeggio',
    frequency: 528,
    mode: 'single',
    tier: 'Intuitive/Traditional',
    evidence: 'No peer-reviewed clinical trials',
    modality: 'Speakers or headphones',
    duration: 'Flexible',
    notes: 'DNA repair, transformation (theoretical/traditional use).',
    contraindications: 'None known.',
    type: 'traditional',
  },
  {
    id: 'binaural-10hz',
    label: 'Alpha (10Hz) Binaural',
    left: 200,
    right: 210,
    mode: 'binaural',
    tier: 'Intuitive/Traditional',
    evidence: 'Mixed/controversial',
    modality: 'Headphones',
    duration: 'Flexible',
    notes: 'Immediate stress reduction (anecdotal).',
    contraindications: 'Tinnitus, seizure disorders.',
    type: 'traditional',
  },
];

const BRAND_CONFIG = {
  displayName: 'TerraTone',
  color: 'rgba(76, 175, 80, 0.7)',
  accent: '#4CAF50',
  description: 'Universal Frequency Generator',
};

const GlassmorphicToneGenerator = ({ onMetaRecord }) => {
  const [frequency, setFrequency] = useState(PROTOCOLS[0].frequency || 40);
  const [binaural, setBinaural] = useState({ left: PROTOCOLS[1].left || 200, right: PROTOCOLS[1].right || 202 });
  const [duration, setDuration] = useState(10);
  const [isPlaying, setIsPlaying] = useState(false);
  const [mode, setMode] = useState(PROTOCOLS[0].mode);
  const [showAdvanced, setShowAdvanced] = useState(false);
  const [selectedProtocol, setSelectedProtocol] = useState(PROTOCOLS[0]);
  const audioCtxRef = useRef(null);
  const oscRef = useRef(null);
  const oscLeftRef = useRef(null);
  const oscRightRef = useRef(null);

  const safeCloseCtx = async (ctx) => {
    if (ctx && ctx.state !== 'closed') {
      try { await ctx.close(); } catch {}
    }
  };

  const handlePlay = () => {
    if (isPlaying) return;
    const ctx = new (window.AudioContext || window.webkitAudioContext)();
    audioCtxRef.current = ctx;
    if (mode === 'single') {
      const osc = ctx.createOscillator();
      osc.type = 'sine';
      osc.frequency.value = frequency;
      osc.connect(ctx.destination);
      osc.start();
      oscRef.current = osc;
      setIsPlaying(true);
      if (onMetaRecord) {
        onMetaRecord({ mode, frequency, duration, timestamp: Date.now() });
      }
      setTimeout(async () => {
        osc.stop();
        await safeCloseCtx(ctx);
        setIsPlaying(false);
      }, duration * 1000);
    } else {
      const merger = ctx.createChannelMerger(2);
      const oscL = ctx.createOscillator();
      const oscR = ctx.createOscillator();
      oscL.type = oscR.type = 'sine';
      oscL.frequency.value = binaural.left;
      oscR.frequency.value = binaural.right;
      oscL.connect(merger, 0, 0);
      oscR.connect(merger, 0, 1);
      merger.connect(ctx.destination);
      oscL.start();
      oscR.start();
      oscLeftRef.current = oscL;
      oscRightRef.current = oscR;
      setIsPlaying(true);
      if (onMetaRecord) {
        onMetaRecord({ mode, left: binaural.left, right: binaural.right, duration, timestamp: Date.now() });
      }
      setTimeout(async () => {
        oscL.stop();
        oscR.stop();
        await safeCloseCtx(ctx);
        setIsPlaying(false);
      }, duration * 1000);
    }
  };

  const handleStop = async () => {
    if (mode === 'single' && oscRef.current && audioCtxRef.current) {
      oscRef.current.stop();
      await safeCloseCtx(audioCtxRef.current);
      setIsPlaying(false);
    } else if (mode === 'binaural' && oscLeftRef.current && oscRightRef.current && audioCtxRef.current) {
      oscLeftRef.current.stop();
      oscRightRef.current.stop();
      await safeCloseCtx(audioCtxRef.current);
      setIsPlaying(false);
    }
  };

  const config = BRAND_CONFIG;

  return (
    <div style={{
      background: `rgba(30, 40, 40, 0.35)`,
      boxShadow: `0 8px 32px 0 rgba(31, 38, 135, 0.25), 0 0 0 6px ${config.accent}33`,
      backdropFilter: 'blur(24px)',
      WebkitBackdropFilter: 'blur(24px)',
      borderRadius: 32,
      border: `2.5px solid ${config.accent}`,
      padding: 40,
      maxWidth: 520,
      margin: '48px auto',
      color: '#fff',
      fontFamily: 'Segoe UI, Roboto, Arial, sans-serif',
      transition: 'background 0.3s',
      position: 'relative',
      overflow: 'visible',
    }}>
      {/* Glassmorphic colored edge glow */}
      <div style={{
        position: 'absolute',
        top: -10, left: -10, right: -10, bottom: -10,
        borderRadius: 36,
        border: `3px solid ${config.accent}`,
        boxShadow: `0 0 32px 8px ${config.accent}88`,
        pointerEvents: 'none',
        zIndex: 0,
        opacity: 0.7
      }} />
      <h1 className="terratone-header">TerraTone Frequency Generator</h1>
      <div style={{ fontSize: 18, marginBottom: 28, color: '#e0ffe0', fontWeight: 500, textShadow: '0 1px 8px #2228' }}>{config.description}</div>
      {/* Protocol Selector */}
      <div style={{ marginBottom: 28 }}>
        <label style={{ fontWeight: 700, fontSize: 17, color: config.accent, letterSpacing: 1 }}>Tone Generator Pathways:</label>
        <label className="terratone-companion" style={{ fontWeight: 700, fontSize: 17, color: config.accent, letterSpacing: 1 }}>Tone Generator Pathways:</label>
        {/* ...existing code... */}
        <div style={{ display: 'flex', flexWrap: 'wrap', gap: 10, marginTop: 10 }}>
          {PROTOCOLS.map(p => (
            <button
              key={p.id}
              onClick={() => {
                setMode(p.mode);
                if (p.mode === 'single') {
                  setFrequency(p.frequency || 40);
                } else {
                  setBinaural({ left: p.left || 200, right: p.right || 210 });
                }
                setShowAdvanced(false);
                setSelectedProtocol(p);
              }}
              style={{
                background: (mode === p.mode && ((p.mode === 'single' && frequency === p.frequency) || (p.mode === 'binaural' && binaural.left === p.left && binaural.right === p.right))) ? config.accent : 'rgba(40,40,40,0.7)',
                color: '#fff',
                border: `2px solid ${config.accent}`,
                borderRadius: 10,
                padding: '8px 18px',
                fontWeight: 700,
                fontSize: 15,
                minWidth: 180,
                marginBottom: 4,
                boxShadow: (mode === p.mode && ((p.mode === 'single' && frequency === p.frequency) || (p.mode === 'binaural' && binaural.left === p.left && binaural.right === p.right))) ? `0 0 12px 2px ${config.accent}88` : 'none',
                transition: 'box-shadow 0.2s, background 0.2s',
                outline: 'none',
                cursor: 'pointer',
              }}
            >
              {p.label} <span style={{ fontSize: 12, color: '#ffd', fontWeight: 400 }}>({p.tier})</span>
            </button>
          ))}
        </div>
      </div>
      {/* Protocol Info Panel */}
      {selectedProtocol && (
        <div style={{ background: 'rgba(255,255,255,0.08)', borderRadius: 12, padding: 16, marginBottom: 16, color: '#e0e0e0' }}>
          <div className="terratone-companion" style={{ background: 'rgba(255,255,255,0.08)', borderRadius: 12, padding: 16, marginBottom: 16, color: '#e0e0e0' }}>
            <div><b>Tier:</b> {selectedProtocol.tier}</div>
            <div><b>Evidence:</b> {selectedProtocol.evidence}</div>
            <div><b>Modality:</b> {selectedProtocol.modality}</div>
            <div><b>Recommended Duration:</b> {selectedProtocol.duration}</div>
            <div><b>Notes:</b> {selectedProtocol.notes}</div>
            <div><b>Contraindications:</b> {selectedProtocol.contraindications}</div>
            <div><b>Type:</b> {selectedProtocol.type === 'clinical' ? 'Peer-reviewed/Clinical' : 'Traditional/Intuitive'}</div>
          </div>
        </div>
      )}
      {/* Evidence Library Access */}
      <div style={{ marginBottom: 16 }}>
        <button style={{ background: '#222', color: config.accent, border: 'none', borderRadius: 8, padding: '8px 20px', fontWeight: 600 }} onClick={() => window.open('/evidence-library', '_blank')}>View Evidence Library</button>
        <button className="terratone-companion" style={{ background: '#222', color: config.accent, border: 'none', borderRadius: 8, padding: '8px 20px', fontWeight: 600 }} onClick={() => window.open('/evidence-library', '_blank')}>View Evidence Library</button>
      </div>
      {/* Controls - Professional Dials/Buttons Placeholder */}
      <div style={{ marginBottom: 24, display: 'flex', flexDirection: 'column', alignItems: 'center', gap: 12 }}>
        {mode === 'single' ? (
          <>
            {/* Frequency Dial Placeholder */}
            <div style={{ marginBottom: 8 }}>
              <label style={{ fontWeight: 700, fontSize: 16, marginRight: 12 }}>Frequency</label>
                            <label className="terratone-companion" style={{ fontWeight: 700, fontSize: 16, marginRight: 12 }}>Frequency</label>
              <input type="range" min={20} max={20000} value={frequency} onChange={e => setFrequency(Number(e.target.value))} disabled={isPlaying} style={{ width: 220, accentColor: config.accent }} />
              <span style={{ marginLeft: 12, fontWeight: 600, fontSize: 16 }}>{frequency} Hz</span>
                          <span className="terratone-companion" style={{ marginLeft: 12, fontWeight: 600, fontSize: 16 }}>{frequency} Hz</span>
            </div>
          </>
        ) : (
          <>
            {/* Dual Dials for Binaural */}
            <div style={{ display: 'flex', alignItems: 'center', gap: 24, marginBottom: 8 }}>
              <div>
                <label style={{ fontWeight: 700, fontSize: 16, marginRight: 8 }}>Left</label>
                                <label className="terratone-companion" style={{ fontWeight: 700, fontSize: 16, marginRight: 8 }}>Left</label>
                <input type="range" min={20} max={20000} value={binaural.left} onChange={e => setBinaural({ ...binaural, left: Number(e.target.value) })} disabled={isPlaying} style={{ width: 120, accentColor: config.accent }} />
                <span style={{ marginLeft: 8, fontWeight: 600, fontSize: 16 }}>{binaural.left} Hz</span>
                              <span className="terratone-companion" style={{ marginLeft: 8, fontWeight: 600, fontSize: 16 }}>{binaural.left} Hz</span>
              </div>
              <div>
                <label style={{ fontWeight: 700, fontSize: 16, marginRight: 8 }}>Right</label>
                                <label className="terratone-companion" style={{ fontWeight: 700, fontSize: 16, marginRight: 8 }}>Right</label>
                <input type="range" min={20} max={20000} value={binaural.right} onChange={e => setBinaural({ ...binaural, right: Number(e.target.value) })} disabled={isPlaying} style={{ width: 120, accentColor: config.accent }} />
                <span style={{ marginLeft: 8, fontWeight: 600, fontSize: 16 }}>{binaural.right} Hz</span>
                              <span className="terratone-companion" style={{ marginLeft: 8, fontWeight: 600, fontSize: 16 }}>{binaural.right} Hz</span>
              </div>
            </div>
          </>
        )}
        {/* Duration Dial */}
        <div style={{ marginBottom: 8 }}>
          <label style={{ fontWeight: 700, fontSize: 16, marginRight: 12 }}>Duration</label>
                    <label className="terratone-companion" style={{ fontWeight: 700, fontSize: 16, marginRight: 12 }}>Duration</label>
          <input type="range" min={1} max={3600} value={duration} onChange={e => setDuration(Number(e.target.value))} disabled={isPlaying} style={{ width: 180, accentColor: config.accent }} />
          <span style={{ marginLeft: 12, fontWeight: 600, fontSize: 16 }}>{duration} s</span>
                  <span className="terratone-companion" style={{ marginLeft: 12, fontWeight: 600, fontSize: 16 }}>{duration} s</span>
        </div>
      </div>
      <div style={{ marginBottom: 16 }}>
        <label style={{ fontWeight: 600 }}>Duration (seconds): </label>
        <input type="number" min={1} max={3600} value={duration} onChange={e => setDuration(Number(e.target.value))} disabled={isPlaying} style={{ width: 80, fontSize: 16, borderRadius: 6, border: '1px solid #ccc', padding: 4, marginLeft: 8 }} />
      </div>
      <div style={{ display: 'flex', gap: 18, marginBottom: 18, justifyContent: 'center' }}>
        <button onClick={handlePlay} disabled={isPlaying} style={{
          background: isPlaying ? '#222' : config.accent,
          color: '#fff',
          padding: '16px 38px',
          border: 'none',
          borderRadius: 16,
          fontWeight: 900,
          fontSize: 22,
          boxShadow: isPlaying ? `0 0 16px 4px #fff8` : `0 2px 16px 0 ${config.accent}55`,
          letterSpacing: 1,
          outline: isPlaying ? `2px solid #fff` : 'none',
          transition: 'all 0.2s',
          cursor: isPlaying ? 'not-allowed' : 'pointer',
          textShadow: '0 2px 8px #2228',
        }}>
          {isPlaying ? 'Playing...' : 'Play Tone'}
        </button>
        {isPlaying && (
          <button onClick={handleStop} style={{
            background: '#888',
            color: '#fff',
            padding: '16px 38px',
            border: 'none',
            borderRadius: 16,
            fontWeight: 900,
            fontSize: 22,
            boxShadow: '0 2px 16px 0 #8888',
            letterSpacing: 1,
            outline: 'none',
            textShadow: '0 2px 8px #2228',
          }}>Stop</button>
        )}
      </div>
      <div style={{ fontSize: 14, color: '#e0e0e0', marginTop: 12 }}>
        <b>Quantified:</b> {mode === 'single' ? `Frequency: ${frequency}Hz` : `Left: ${binaural.left}Hz, Right: ${binaural.right}Hz`} | Duration: {duration}s | Mode: {mode}
      </div>
      {/* Safety Disclaimer */}
      <div className="terratone-companion" style={{ fontSize: 13, color: '#ffb', background: 'rgba(255,255,255,0.04)', borderRadius: 8, padding: 10, marginBottom: 12 }}>
        <b>Disclaimer:</b> Protocols are labeled by evidence tier. Peer-reviewed pathways are based on published clinical evidence; traditional pathways are included for holistic and intuitive value. This does not constitute medical treatment. Consult healthcare providers for cognitive or neurological symptoms. Contraindications: Photosensitive epilepsy (for visual components), tinnitus (caution with high frequencies), seizure disorders.
      </div>
    </div>
  );
};

export default GlassmorphicToneGenerator;
